import React, {Component} from 'react';
import {connect} from 'react-redux';

class AttendeeList extends Component {

  constructor(props) {
    super(props);

  }


  render() {

    return (
        <div
            className="col-8 col-sm-6 col-md-4 col-lg-3 mb-2 p-0 px-1">
          <div className="card ">
            <div className="card-body px-3 py-2 d-flex align-items-center justify-content-center">
              {this.state.attendees && this.state.attendees.length ? (this.state.attendees.map((attendee)=>{
                return (
                    <div key={attendee.attendeeID}>{attendee.attendeeName}</div>
                );
              })): null }
            </div>
          </div>
        </div>
    );
  }
}

function mapStateToProps(state) {
  return {};
}

export default AttendeeList;
